(9, 'POKEMON ESCARLATA/PURPURA', 'DIGITAL', 1299, 10, '', 'img/videojuegos/pokemonpuresc.jpg', 'Pokémon Escarlata y Pokémon Púrpura son un par de videojuegos de rol en desarrollo por Game Freak. Su lanzamiento está previsto para el 18 de noviembre de 2022, ​​ siendo publicados por The Pokémon Company para Nintendo Switch.'),
