(11, 'SUPER MARIO ODYSSEY', 'DIGITAL', 1199, 10, '', 'img/videojuegos/mariooddysey.jpg', 'El juego muestra a Mario viajando a través de varios mundos conocidos como «Reinos», en una nave con forma de sombrero llamada Odyssey. La Odyssey usa como combustible unos objetos con forma de lunas llamados energilunas, las cuales se reparten entre los 17 reinos y se obtienen al hacer ciertas acciones.'),
