(25, 'SPIDER MAN: MILES MORALES', 'DIGITAL', 1099, 15, '', 'img/videojuegos/spiderman.jpg', 'Una guerra por el control de la Nueva York de Marvel estalló entre una corporación de energía siniestra y un ejército criminal con tecnología de punta. Ahora que su hogar es el epicentro de la batalla, Miles debe aprender el costo de convertirse en héroe y decidir qué sacrificar por el bien mayor.'),
(26, 'SPIDER MAN: MILES MORALES', 'FISICA', 1099, 15, '', 'img/videojuegos/spiderman.jpg', 'Una guerra por el control de la Nueva York de Marvel estalló entre una corporación de energía siniestra y un ejército criminal con tecnología de punta. Ahora que su hogar es el epicentro de la batalla, Miles debe aprender el costo de convertirse en héroe y decidir qué sacrificar por el bien mayor.'),
