(28, 'THE LAST OF US 2', 'FISICA', 1299, 15, '', 'img/videojuegos/thelastofus2.jpg', 'Ambientado cinco años después de The Last of Us (2013), el juego se centra en dos personajes jugables en un Estados Unidos post-apocalíptico cuyas vidas se entrelazan: Ellie, que busca venganza después de sufrir una tragedia, y Abby, una soldado que se ve envuelta en un conflicto entre su milicia y un culto religioso.'),
(29, 'RATCHET AND CLANK: RIFT APART', 'DIGITAL', 1099, 15, '', 'img/videojuegos/ratchetandclank.jpg', 'Un malvado emperador robótico está decidido a conquistar mundos interdimensionales, y tiene la mira puesta en la dimensión de Ratchet y Clank. Tendrás que desempolvar el arsenal alucinante de esta pareja dinámica y poner fin a la amenaza de un colapso dimensional.'),
(30, 'RATCHET AND CLANK: RIFT APART', 'FISICA', 1099, 15, '', 'img/videojuegos/ratchetandclank.jpg', 'Un malvado emperador robótico está decidido a conquistar mundos interdimensionales, y tiene la mira puesta en la dimensión de Ratchet y Clank. Tendrás que desempolvar el arsenal alucinante de esta pareja dinámica y poner fin a la amenaza de un colapso dimensional.'),
(31, 'DETROIT: BECOME HUMAN', 'DIGITAL', 399, 15, '', 'img/videojuegos/detroitbecomehuman.jpg', 'Se trata de un androide con forma humana fabricada con una nueva conciencia artificial, lo que la hace escapar de las instalaciones donde fue creada, para intentar vivir entre los humanos como una más y encontrar su lugar en un mundo donde los robots son utilizados como meros sirvientes de la sociedad.\n\n'),
