(33, 'MINECRAFT FOR WINDOWS', 'DIGITAL', 299, 20, '', 'img/videojuegos/minecraft.jpg', 'Minecraft es un videojuego de construcción de tipo «mundo abierto» o sandbox creado originalmente por el sueco Markus Persson (conocido comúnmente como «Notch»),​ y posteriormente desarrollado por Mojang Studios (actualmente parte de Microsoft).'),
