(35, 'ENTER THE GUNGEON', 'DIGITAL', 99, 20, '', 'img/videojuegos/enterthegungeon.jpg', 'Enter the Gungeon es un dungeon crawler de tiroteos que sigue a una banda de marginados arrepentidos en su intento de conseguir la absolución personal a base de disparar, saquear, dar volteretas y voltear mesas para alcanzar el tesoro supremo de la legendaria Armazmorra: el arma que puede matar el pasado.'),
