(37, 'INSCRYPTION', 'DIGITAL', 109, 20, '', 'img/videojuegos/inscryption.jpg', 'Inscryption es un juego de cartas, una odisea negra como la tinta que mezcla el «roguelike» de creación de mazos, puzles de estilo «escape room» y terror psicológico en un batido con un toque de sangre.'),
